def substrCount(n, s):
    result = 0
    
    # def isSym(string, ind):
    #     val = 0
    #     diff = 1
    #     testing = True
        
    #     while (ind - diff >= 0) and (ind + diff <= n-1):
    #         if string[ind-diff] == string[ind+diff]:
    #             print(string[ind-diff], string[ind], string[ind+diff])
    #             val += 1
    #             diff += 1
    #         else:
    #             break
    #     return val 
    
    def isSpecial(string, ind):
        val = 0
        diff = 1
        special = string[ind-diff]
        
        while (ind - diff >= 0) and (ind + diff <= n-1):
            if (string[ind-diff] == special) and (string[ind+diff] == special):
                val += 1
                diff += 1
            else:
                break
        return val 

    start = s[0]
    consecutive = 0  # consecutive numbers
    
    for index in range(n):
        
        # check 
        if(s[index] == start):
            consecutive += 1
        else:
            result += ((1+consecutive)*consecutive)//2
            consecutive = 1
            start = s[index]        
        
            if (index > 1) or (index < n-1):
                numSym = isSpecial(s, index)
                result += numSym
        
    result += ((1+consecutive)*consecutive)//2

    return result

string = ""
res = substrCount(55269, string)
print(res)